  \"deepwater-canyons-2012-pathways-to-the-abyss-on-noaa-ship-nancy-foster-between-20120815-and-201\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Mid-Atlantic Deep-Water Canyons project
  is co-funded by the Bureau of Ocean Energy Management (BOEM) and NOAA's Office of
  Ocean Exploration and Research (which provides ships and ROVs for research cruises).
  The project is managed by Continental Shelf Associates, and includes scientific
  partners from several academic institutions and the US Geological Survey (USGS).
  The project will focus on the exploration and characterization of hard bottom communities
  (particularly deep-water corals), soft-bottom communities and shipwreck sites in
  canyons off Virginia and Maryland.  Selected shipwreck sites will be studied to
  determine their historical significance and their function as artificial habitat
  for canyon fauna. The biology and ecology of these canyons is poorly described,
  and they harbor significant unexplored historical artifacts. Our study will provide
  valuable information to regulatory agencies on distribution of sensitive areas within
  the canyons, as well as contributing scientific information on these ecologically
  important ecosystems.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
